window.bookSummaryJSON = "<p>When accusations of piracy and mass murder are laid against his homeworld, Damien Montgomery is sent to resolve the crisis. As counteraccusations fly and an old flame reenters his life, the newest Hand of the Mage-King of Mars finds himself in the midst of a bloody interstellar shadow war. With the death toll mounting, Damien must decide whether he should trust the world he came from - or the world that asked for his help. The wrong choice will trigger a civil war that could shatter human civilization. No pressure. </p>"; 
